import React from "react";
import CharacterItem from "./CharacterItem";
import Spinner from "../ui/Spinner";

function CharacterGrid() {
  const [CharacterList, GetCharacterList] = useState([]);
  useEffect(() => {
    axios
      .get("https://rickandmortyapi.com/api/character/")
      .then((response) => {
        console.log("hello", response.data.results);
        GetCharacterList(response.data.results);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  return (
    <section className="character-list">
      <h2>Welcome to Rick n Morty Land</h2>
      {CharacterList.map(({ name, image, status, gender, id }) => {
        return (
          <CharacterCard
            key={id}
            name={name}
            image={image}
            status={status}
            gender={gender}
          />
        );
      })}
    </section>
  );
}

export default CharacterGrid;
